import React from 'react';
//import logo from '../../img/logo-187x66.png';
import classes from './About.module.css'
import BlockHead from "../BlockHead/BlockHead";
import BannerHead from "../../img/slider_image.png";


let arrHead = " is an IT company in India, offering quality software " +
    "related solutions including <strong>Mobile Application Development" +
    "</strong>,  We believe in <strong>“Complete Customer Satisfaction”</strong>" +
    "  as our definition of quality. We focus to deliver our expertise to our " +
    "clients within time and make sure that our solutions be aesthetic, " +
    "technically functional, user-friendly and responsive.";




const  About = () =>{
    return (
        <div className={classes.block}>
            <h1>about</h1>
            <span>sparkle appz</span>
            <BlockHead  text={arrHead} img={BannerHead}/>
        </div>
    );
};


export default About;
